import React, { useRef, useState } from "react";

interface FormValue {
  name: string;
  email: string;
  age: int;
  password: string;
  pwCon: string;
}

export const SignupPage = (props: any) => {
  const {
    register,
    handleSubmit,
    formState: { errors },
    getValues,
  } = useForm < FormValue > { mode: "onChange" };
};
